import { palette } from "styles/theme";
import MobileBottomButton from "components/common/Button/MobileBottomButton";
import Button from "components/common/Button";
import ButtonGroup from "./ButtonGroup";

const LoginForm = () => {
  return (
    <>
      <form css={loginFormStyle}>
        <InputText
          themeType="light"
          type="email"
          placeholder="이메일"
          marginBottom="30px"
        />
        <InputText themeType="light" type="password" placeholder="비밀번호" />

        <ButtonGroup />
      </form>

      <MobileBottomButton>로그인</MobileBottomButton>
    </>
  );
};

export default LoginForm;
